import React, { useState } from 'react'
import axios from "axios";


const App = () => {
  const [city, cityName] = useState();
  async function handleSubmit(e){
    e.preventDefault();
    cityName(city);
    console.log("Submitted");
    try{
      const responce = await axios.post("https://localhost:3001/", {city});
    } catch(err){
      console.log(err)
    }
  }

  function handleOnchange(e){
    console.log(e.target.value);
    cityName(e.target.value);
  }


  return (
    <form onSubmit={handleSubmit}>
    <input onChange={handleOnchange} type='text' placeholder='Write your city name' value={city}/>
    <input type='Submit' />

    </form>
  )
}

export default App
